import React, {Component} from 'react';
import {Card, Collapse} from "antd";
import img_OA from '../../images/production/OA.jpg';

const {Meta} = Card;
const {Panel} = Collapse;

class Product extends Component {
    render() {
        return (
            <Card style={{width: "496px",height:"400px",paddingTop:"0px",marginTop:"0px"}} cover={<img src={img_OA} alt=""/>}>
                <Meta title="OA系统" description="提供基础OA系统"/>
                <Collapse>
                    <Panel header="展开详情">
                        <p>默认授权：1000个账号</p>
                        <p>增值授权：1000个账号/¥100,000.00</p>
                    </Panel>
                </Collapse>
            </Card>
        );
    }
}

export default Product;
